import React, {Component} from 'react';
import './menu.css';
import ComponentBreakfast from './breakfast.js'

const Breakfast = () => {
    return <ComponentBreakfast/>  
}

class ComponentButtons extends Component{
    render(){
        return (

        <React.Fragment>
                <div className="rectangle">
                <button type="button" onClick={this.Breakfast} className="btn btn-outline-info">Desayunos</button>   
                <button type="button" onClick={this.Breakfast} className="btn btn-outline-info2">Almuerzos</button>

                </div>

                <div className="rectangle2">
                </div>      

        </React.Fragment>
        );
    }
}    


export default ComponentButtons;
